/usr/libexec/PlistBuddy -c "Set :CFBuildNumber $buildNumber" $buildPlist
/usr/libexec/PlistBuddy -c "Set :CFBuildDate $buildDate" $buildPlist
/usr/libexec/PlistBuddy -c "Set :CFBundleVersion $buildMajorVersion.$buildVersion.$buildNumber" $buildPlist
/usr/libexec/PlistBuddy -c "Set :CFBundleShortVersionString $buildMajorVersion.$buildVersion" $buildPlist
/usr/libexec/PlistBuddy -c "Set :CFBundleLongVersionString $buildMajorVersion.$buildVersion.$buildNumber.$buildDate" $buildPlist
</string>
